import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    const passwordGenerator = document.querySelector(".passwordGenerator");
  });

  return (
    <>
      <div className="myBox position-absolute top-50 start-50 translate-middle d-flex">
        <h1 className="passwordGenerator">Password Generator</h1>
        <input
          type="text"
          readOnly
          value="10"
          style={{ height: "50px", width: "350px" }}
        />
        <div>
          <input type="range" name="" id="inputRange" />
          <label htmlFor="inputRange " className="px-3 fw-bolder">
            10
          </label>
        </div>
      </div>
    </>
  );
};

export default App;
